import React from 'react';
import { NavLink } from 'react-router-dom';
import S from './Login.module.css'
const Login = (props) =>
{
    let changeIsAut = () =>
    {
        props.changeIsAuth()
    }
    return(
        
<div className={S.Login}
> <NavLink to="/mimba/Swiper">LOGIN <button>Готово</button></NavLink>
</div>
    )
}
export default Login
